DROP TABLE IF EXISTS `security_overview`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `security_overview`  AS SELECT `r`.`id` AS `id`, `r`.`name` AS `name`, `r`.`email` AS `email`, `r`.`failed_login_attempts` AS `failed_login_attempts`, `r`.`account_locked_until` AS `account_locked_until`, `r`.`last_login_at` AS `last_login_at`, `r`.`registration_ip` AS `registration_ip`, count(`sl`.`id`) AS `security_events_24h`, count(`as2`.`id`) AS `active_sessions` FROM ((`restaurants` `r` left join `security_logs` `sl` on(`r`.`id` = `sl`.`restaurant_id` and `sl`.`created_at` > current_timestamp() - interval 24 hour)) left join `active_sessions` `as2` on(`r`.`id` = `as2`.`restaurant_id`)) GROUP BY `r`.`id` ;

